import React, { Component } from "react";


export default class AddItem extends React.Component{

    state= {}

    createNewProduct = (quantity, product) => {
        return{
            product: {
              id: product.id,
              name: product.name,
              priceInCents: product.priceInCents
            },
            quantity: quantity
          }
    }

    render(){

        return(
            <option value={this.props.product}>{this.props.product}</option>
            )

    };


}
